    #adds account details to list of stored accounts to scrape
    def linkAccount(self, accountName, orderEmail, userEmail):
        #accountNames.append(accountName.text())
        funcErrors = False
        if orderEmail == 0:
            companyEmail = "orderconfirmation@" + accountName.text().lower() + ".com"
            #orderEmails.append(companyEmail) 
        else:
            if "@" in orderEmail.text():
                #orderEmails.append(orderEmail.text())
                self.otherCoEmailError.setText("")
            else:
                self.otherCoEmailError.setText("Please use a correct email")
                funcErrors = True
    
        if "@" in userEmail.text():
            #userEmails.append(userEmail.text())
            self.otherUserEmailError.setText("")
            self.brandErrorMessage.setText("")
        else:
            self.otherUserEmailError.setText("Please use a correct email")
            self.brandErrorMessage.setText("Please use a correct email")
            funcErrors = True
        if not funcErrors:
            accountNames.append(accountName.text())
            if orderEmail == 0:
                orderEmails.append(companyEmail)
            else:
                orderEmails.append(orderEmail.text())
            userEmails.append(userEmail.text())
            self.contentWidget.setCurrentIndex(11)
            self.displayAccountSettings()
    
