    def login(self):
        if self.signin_email.text() in loginPasswords.keys() and loginPasswords[self.signin_email.text()] == self.signin_password.text():
            self.contentWidget.setCurrentIndex(1)
            self.topBar.setCurrentIndex(2)
            self.bottomBar.setCurrentIndex(0)
        else:
            # this is where we'd put error messages
            pass
        # reset fields after clicking signin
        self.signin_email.setText("")
        self.signin_password.setText("")

    def create_account(self):
        if "@" in self.signup_email.text() and (self.signup_password.text() == self.signup_reenter.text() != "") \
        and (self.signup_MM.text().isdecimal() and len(self.signup_MM.text()) == 2)\
        and (self.signup_DD.text().isdecimal() and len(self.signup_DD.text()) == 2)\
        and (self.signup_YYYY.text().isdecimal() and len(self.signup_YYYY.text()) == 4)\
        and self.signup_tos.isChecked():

            self.contentWidget.setCurrentIndex(1)
            self.topBar.setCurrentIndex(2)
            self.bottomBar.setCurrentIndex(0)
            # replace this with an actual database integration if we were to actually
            loginPasswords[self.signup_email.text()] = self.signup_password.text()
        else:
            # this is where we'd put error messages
            pass
        # reset fields after clicking signup
        self.signup_email.setText("")
        self.signup_password.setText("")
        self.signup_reenter.setText("")
        self.signup_MM.setText("")
        self.signup_DD.setText("")
        self.signup_YYYY.setText("")
        self.signup_tos.setChecked(False)

